import React from 'react';
import { NavLink } from 'react-router-dom';

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Nav from 'react-bootstrap/Nav';


const AdminMenu = (props) => {

  return (
    <Col style={{ flexDirection: "column" }} md="3">
      <div className="default-box">
        <div style={{ padding: ".5rem 1rem" }} className="box-header">Admin Menu</div>
        <Nav className="flex-column">
          <Nav><NavLink to="/admin/movies">Movies</NavLink></Nav>
          <Nav.Link eventKey="link-1">Directors</Nav.Link>
          <Nav.Link eventKey="link-2">Actors</Nav.Link>
          <Nav.Link eventKey="link-2">Genres</Nav.Link>
        </Nav>
      </div>
    </Col>
  );
}
export default AdminMenu;
